import React from "react";
import MeetupList from "../components/meetups/MeetupList";

const AllMeetupsPage = (props) => {
  return (
    <section>
      <h1>All Meetups</h1>
      <MeetupList meetups={props.meetups} />
    </section>
  );
};

export default AllMeetupsPage;
